import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  height: 70px;
  background-color: #46d09d;
  position: fixed;
  top: 0;
`;

const MainContent = styled.div`
  width: 95%;
  max-width: 1200px;
  display: flex;
  flex-direction: row;
  justify-content: flex-start;
`;

const Header = () => {
  return (
    <Container>
      <MainContent></MainContent>
    </Container>
  );
};

export default Header;
